@7:43 apparently PostgreSQL is more lenient. On MSSQL I have to add 'order by' to partition by. Making that syntax: 

select e.*, row_number() over (partition by dept_name order by dept_name) as rn from employee e; 

Also, I can't add this to it: 

where Row_Num > 1 

It says it's an invalid column name even if I single quote it. I have to cast it as integer I think. Just want to add this post. Maybe there is a way to do it.
